import React from "react";
import styled, { ThemeProvider } from "styled-components";

const Ban = styled.div`
  width: 100%;
  position: relative;
  & img {
    top: 0;
    left: 0;
    position: absolute;
    border-radius: 50%;
  }
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Ban>
          <img
            src={require("./img/yone.jpg")}
            width={"70%"}
            style={{
              top: "75%",
              left: "50%",
              transform: "translateX(-50%)",
            }}
          />
          <img
            src={require("../../../config/assets/ban-border-blue.png")}
            width={"100%"}
          />
        </Ban>
      </ThemeProvider>
    );
  }
}
